function Footer() {
  return (
 <footer>
  <Container>
    <Row>
      <Col>
      <h3>GET IN TOUCH</h3>
      <p>t is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.</p>
      <div>
        <InstagramIcon/>
      </div>
      </Col>
      <Col>
        
        </Col>
    </Row>
  </Container>
 </footer>
  );
}

export default Footer;
